import React, { useState } from 'react';
import './sign-up.style.scss';

import { FormInput } from '../form-input/form-input.component';
import { StyleButton } from '../styled-button/styled-button.component';
import { auth, createUser } from '../../firebase/filrebase.util';

export const SignUp = () => {
//   console.log('hahia');
  const [displayName, setDisplayName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  const handleSubmit = () => {

  };
  return (
    <div className="sign-up">
      <div className="title">
        <h1> Do not have Account Yet ?</h1>
        <span>Sign up with email now!</span>
      </div>

      <form onSubmit={handleSubmit}>
        <FormInput
          name="displayName"
          type="text"
          label="DISPLAY NAME"
          value={displayName}
          handleChange={(event) => setDisplayName(event.target.value)}
          required
        />
        <FormInput
          name="email"
          type="email"
          label="EMAIL"
          value={email}
          handleChange={(event) => setEmail(event.target.value)}
          required
        />
        <FormInput
          name="password"
          type="password"
          label="PASSWORD"
          value={password}
          handleChange={(event) => setPassword(event.target.value)}
          required
        />
        <FormInput
          name="confirmPassword"
          type="text"
          label="Confirm Your Password"
          value={confirmPassword}
          handleChange={(event) => setConfirmPassword(event.target.value)}
          required
        />
        <div className="buttons">
          <StyleButton type="submit"> Sign Up Now! </StyleButton>
        </div>
      </form>
    </div>
  );
};
export default SignUp;
